import React from "react"

function BlogPost(props){
    return(
        <div>
            <h3>{props.title}</h3>
            <h4>{props.subTitle}</h4>
            <span>{`Posted by ${props.author} on`} </span>
            <span>{props.date}</span>
        </div>
    )
}

export default BlogPost
